import React from "react";
import Header from "../Header/Header";
import Sidebar from "../Sidebar/Sidebar";
import PortfolioPage from "./PortfolioPage";

const Portfolio = () => {
    return (
        <div>
        <Sidebar/>
        <Header/>
        <PortfolioPage/>
        </div>
    )
}

export default Portfolio
